import React from "react";
import "../../assets/css/compeounder.css";
import "../../assets/css/innerstyle.css";

const InererBannerPage = () => {
  return (
    <section className="innerBanner">
	<div className="container">
		<div className="row justify-content-center">
			<div className="col-md-8">
				<div className="homeHeading">
					<div className="select-area">
						<div className="select-area-wrapper">
							<a href="#" className="btn btn-secondary dropdown-toggle" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false"><i className="fa-solid fa-magnifying-glass"></i>All Treatments and Venus</a>
							<ul className="dropdown-menu" aria-labelledby="dropdownMenuButton1">
								<li><a className="dropdown-item" href="#">Treatment</a></li>
								<li><a className="dropdown-item" href="#"> Treatment</a></li>
								<li><a className="dropdown-item" href="#">Treatment</a></li>
							</ul>
							<a href="#"><i className="fa-solid fa-location-dot"></i>Current Location</a>
							<a href="#" className="search">Search</a>
						</div>
					</div>
				</div>
			</div>
		</div>
	</div>
</section>
    
  );
};
export default InererBannerPage;
